import React from "react";
import styles from "./ListHeader.module.css";

export const ListHeader = () => {
  return (
    <>
      <td>Full name</td>
      <td>Birtdday</td>
      <td>Gender</td>
      <td>Department</td>
      <td>Salary</td>
    </>
  );
};
